import { uploadImageToFirebase } from './firebaseStorage';

const CLOUDINARY_CLOUD_NAME = 'davjxvz8w';
const UPLOAD_PRESET = 'teddy_bears';
const CLOUDINARY_URL = `https://api.cloudinary.com/v1_1/${CLOUDINARY_CLOUD_NAME}/image/upload`;

// Default fallback image (base64 encoded small teddy bear image for immediate display)
export const DEFAULT_TEDDY_IMAGE = 'data:image/png;base64,';

// Upload image to Cloudinary with fallback to Firebase
export const uploadImageToCloudinary = async (imageFile) => {
  try {
    // Create a unique folder path based on timestamp
    const timestamp = new Date().getTime();
    const folderPath = `teddy_bear_shop/${timestamp}`;

    const formData = new FormData();
    formData.append('file', imageFile);
    formData.append('upload_preset', UPLOAD_PRESET);
    formData.append('folder', folderPath);

    const response = await fetch(CLOUDINARY_URL, {
      method: 'POST',
      body: formData,
    });

    if (!response.ok) {
      const errorText = await response.text();
      console.error('Cloudinary Error:', errorText);
      throw new Error('Failed to upload image to Cloudinary');
    }

    const data = await response.json();
    console.log("Image uploaded to Cloudinary successfully:", data.secure_url);

    return {
      url: data.secure_url,
      publicId: data.public_id,
      provider: 'cloudinary'
    };
  } catch (cloudinaryError) {
    console.error('Cloudinary upload failed, trying Firebase:', cloudinaryError);

    try {
      // Fallback to Firebase Storage
      const firebaseResult = await uploadImageToFirebase(imageFile);
      console.log("Image uploaded to Firebase successfully:", firebaseResult.url);

      return {
        url: firebaseResult.url,
        publicId: firebaseResult.path,
        provider: 'firebase'
      };
    } catch (firebaseError) {
      console.error('Firebase upload also failed:', firebaseError);

      // Return default image as last resort
      console.log("Using default image as fallback");
      return {
        url: DEFAULT_TEDDY_IMAGE,
        publicId: 'default_teddy',
        provider: 'default'
      };
    }
  }
};
